export const stackIconGetter = stack => {
      if(stack.toLowerCase() === "python") return "https://i.pinimg.com/originals/82/a2/18/82a2188c985ce75402ae44fc43fe7e5e.png";
      if(stack.toLowerCase() === "flask") return "https://static-00.iconduck.com/assets.00/flask-icon-1594x2048-84mjydzf.png";
      if(stack.toLowerCase() === "html") return ("https://static.vecteezy.com/system/resources/previews/013/313/458/non_2x/html-icon-3d-rendering-illustration-vector.jpg");
      if(stack.toLowerCase() === "css") return require("https://e7.pngegg.com/pngimages/66/60/png-clipart-web-development-cascading-style-sheets-css3-computer-icons-css-miscellaneous-blue-thumbnail.png");
}
